(self.webpackChunkdemo=self.webpackChunkdemo||[]).push([[1361],{1361:n=>{n.exports='@if (currentQuestion < 2) {\n    <p>{{ currentQuestion + 1 }}. {{ questionTitles[currentQuestion] }}</p>\n    <form [formGroup]="form">\n        @for (option of questions[currentQuestion]; track option) {\n            <label>\n                <input\n                    size="s"\n                    tuiCheckbox\n                    type="checkbox"\n                    [formControlName]="$index"\n                />\n                {{ option }}\n            </label>\n        }\n    </form>\n    <button\n        size="s"\n        tuiButton\n        type="button"\n        class="tui-space_top-4"\n        (click)="nextQuestion()"\n    >\n        Next\n    </button>\n} @else {\n    <p><b>Your answers</b></p>\n    @for (options of results; track options; let i = $index) {\n        <div class="tui-space_top-4">\n            <p>{{ i + 1 }}. {{ questionTitles[i] }}</p>\n            @for (question of questions[i]; track question; let j = $index) {\n                <label>\n                    <input\n                        size="s"\n                        tuiCheckbox\n                        type="checkbox"\n                        [checked]="options[j]"\n                    />\n                    {{ question }}\n                </label>\n            }\n        </div>\n    }\n}\n'}}]);